const Element = (props) => {
    return ( <div>

    <div className="flex justify-between ">
    <img src={props.img} className="h-24"></img>
    <div className="py-8" >
    <div className="py-2 text-xl font-medium">{props.title}</div>
    <div className="text-md text-slate-400">{props.description}</div>
    <div className="py-2 text-sm  text-slate-600 font-medium">{props.price}$</div>
    </div>
    </div>
    </div> );
}
 
export default Element;
